function query(callback) {
    if (!this.getQueryString()) {
        alert('TwitterSource: Query string not set.')
    }
    var webR = new WebResource(this.requestUrl());
    webR.beAsync();
    connect(webR, 'content', {cb: callback, source: this}, 'cb', {
        converter: function(str) {
            var results = JSON.parse(str).results;
            if (this.getTargetObj().source.customCallback) {
                results.forEach(function (each) {
                    this.customCallback(each);
                }.bind(this.getTargetObj().source));
            }
            return results;
        },
        updater: function($upd, json) {
            if (!this.sourceObj.status.isDone()) return;
            if (!json) return;
            $upd(json);
        }
    });
    webR.get();
}

